import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Open the cart modal (look for cart icon or cart div)
    // Try clicking the cart div with text "Cart"
    await page.waitForSelector('div.cart', { timeout: 5000 });
    await page.click('div.cart');

    // Wait for the cart modal or cart items to appear
    // Try to find the cart modal by id or class
    let cartModalSelector = '#cartModal';
    let cartItemsSelector = '#cartItems';
    let cartItemSelector = '.cart-item';

    // Wait for cart modal or cart items
    await page.waitForSelector(cartModalSelector, { timeout: 5000 });

    // Take screenshot of cart modal open
    const step2 = path.join(screenshotsDir, 'step_2_cart_open.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for at least one cart item to appear
    await page.waitForSelector(`${cartItemsSelector} ${cartItemSelector}`, { timeout: 5000 });

    // Remove the first item from cart
    // Find the first "Remove" button inside the cart items
    const removeButton = await page.$(`${cartItemsSelector} ${cartItemSelector} button.remove-item`);
    if (!removeButton) {
      throw new Error('No remove button found in cart');
    }
    await removeButton.click();

    // Wait for the cart to update (cart item removed)
    // Wait for either the cart item count to decrease, or for "Your cart is empty" message
    // Try to wait for the empty cart message or for the number of cart items to decrease
    let cartItems = await page.$$(cartItemSelector);
    const initialCount = cartItems.length;

    // Wait up to 2 seconds for the cart to update
    await page.waitForTimeout(1000);

    cartItems = await page.$$(cartItemSelector);
    let cartEmpty = false;
    if (cartItems.length < initialCount) {
      // Item removed
    } else {
      // Check for empty cart message
      const emptyCartMsg = await page.$('.empty-cart');
      if (emptyCartMsg) {
        cartEmpty = true;
      }
    }

    // Take screenshot after removal
    const step3 = path.join(screenshotsDir, 'step_3_item_removed.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract cart count from the cart icon/text
    let cartCount = null;
    const cartCountSpan = await page.$('#cartCount');
    if (cartCountSpan) {
      cartCount = await cartCountSpan.textContent();
      cartCount = cartCount.trim();
    } else {
      // Try to extract from the cart div text
      const cartDiv = await page.$('div.cart');
      if (cartDiv) {
        let cartText = await cartDiv.textContent();
        if (cartText) {
          cartText = cartText.replace(/\s+/g, ' ').trim();
          const match = cartText.match(/^(\d+)/);
          if (match) {
            cartCount = match[1];
          }
        }
      }
    }

    return {
      success: true,
      action: "Removed an item from the cart using the Remove button in the cart modal.",
      extractedData: {
        cartCount,
        cartEmpty
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
